    false,nt"url": null,nt"notes": "Shallow-water (<30m) benthic habitat maps
    of the nearshore marine environment of two areas in Southwest Puerto Rico (PR),
    including the Guanica Bay/La Parguera region on the south coast and the Belvedere
    reserve on the west coast, were mapped and characterized using visual interpretation
    of optical remotely sensed imagery. The objective was to provide spatially-explicit
    information on the habitat types, biological cover and live coral cover of the regionu0092s
    coral reef ecosystem. These maps will be used to support marine resource management
    and conservation in the Commonwealth. GeoEye-1 satellite imagery was purchased for
    the mapping area. Photo-interpreters accurately and reliably delineated boundaries
    of features from this GeoEye-1 imagery as they appeared on the computer monitor
    using a software interface.",nt"license_title": null,nt"extras": [{ntt"key":
